import React, {FC} from "react";
import { ITask } from "../interface/interface";
import './style.css'
interface TaskProps {
    task: ITask
}

const Task: FC<TaskProps> = ({task}) => {

    return (
        <li className='task'>
            <div >
                <input type="checkbox" checked={task.isCheck}/>
                <p>{task.title}</p>
            </div>
        </li>
    )
}
export default Task
